                                                    <p>Комплектация: Смартфон, сетевое з/у, портативная стереогарнитура, ключ для извлечения SIM-карты, 2 наклейки с логотипом Apple, интерфейсный кабель, инструкция, упаковка.<br />
Аппарат работает с NanoSIM-картами любых GSM операторов.<br />
Опережая мысли. iPhone 5s задуман с определённой целью. Продуман до мельчайших деталей. И создан в точности с задуманным. Он не просто демонстрирует возможности технологий, но и пользу, которую они способны принести. Это не только шаг вперёд, но и то, куда этот шаг должен быть сделан..<br />
Самые совершенные технологии сконцентрированы здесь. iPhone 5 стал примером того, как целый набор потрясающих технологий может быть реализован в удивительно тонком и лeгком корпусе. В iPhone 5s технологий стало ещё больше. Датчик идентификации по отпечатку пальца Touch ID. Процессор A7 с 64-битной архитектурой. Ещe более впечатляющая камера iSight. И сверхскоростная беспроводная связь..<br />
IOS 7. Настоящее украшение iPhone 5s. iPhone 5s - первый в мире 64-битный смартфон. iOS 7 была задумана и разработана специально под 64-битную архитектуру. Поэтому она так же совершенна, как и сам iPhone.</p>
